description:
Since the stratospheric success of the Squirtwoman series, Patrick Collins and William H. have thoroughly enjoyed themselves indulging in the squirting talents of a long list of gushing superstars: from Squirtwoman, Jada Fire to the new Supersquirt, Sindee Jennings, Flower Tucci, Britney Stevens, and Annie Cruz. These girls are the very best squirters the industry has ever seen and they are all featured in this fourth compendium The Greatest Squirters EVER! 4.

